	(200, NULL, '<font color=\'red\'>Verloren</font><br><font color=\'red\'>Flammi stirbt im Kampf.</font><br>Flammi: -20 Gesundheit durch Ölbrand<br>Flammi: -10 Gesundheit durch Flamme<br>Feuerteufel wendet den Zauber Ölbrand erfolgreich auf Flammi an.<br>Feuerteufel: -2 Gesundheit durch Erdbeben<br>Feuerteufel: -3 Stärke durch Erdbeben<br>Feuerteufel: -1 Abwehr durch Feuerschneise<br>Feuerteufel: -2 Gesundheit durch Feuerschneise<br>Feuerteufel: -3 Magie durch Feuerschneise<br>Feuerteufel: -2 Stärke durch Feuerschneise<br>Flammi wendet den Zauber Erdbeben erfolgreich auf Feuerteufel an.<br><br>Flammi: -10 Gesundheit durch Flamme<br>Flammi: -10 Gesundheit durch Flamme<br>Feuerteufel wendet den Zauber Flamme erfolgreich auf Flammi an.<br>Feuerteufel: -1 Abwehr durch Feuerschneise<br>Feuerteufel: -2 Gesundheit durch Feuerschneise<br>Feuerteufel: -3 Magie durch Feuerschneise<br>Feuerteufel: -2 Stärke durch Feuerschneise<br>Flammi greift Feuerteufel mit Biss an. Feuerteufel kann dem Angriff jedoch ausweichen.<br><br>Flammi: -10 Gesundheit durch Flamme<br>Feuerteufel wendet den Zauber Flamme erfolgreich auf Flammi an.<br>Feuerteufel: -1 Abwehr durch Feuerschneise<br>Feuerteufel: -2 Gesundheit durch Feuerschneise<br>Feuerteufel: -3 Magie durch Feuerschneise<br>Feuerteufel: -2 Stärke durch Feuerschneise<br>Flammi wendet den Zauber Feuerschneise erfolgreich auf Feuerteufel an.<br><br>');
